import React, { useState } from 'react';

import FormControl from '@material-ui/core/FormControl';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';

function EnterLink() {
	const [radioValue, setRadioValue] = useState('Video')

	return (
		<div>
			<FormControl>
				<TextField error requiredlabel="" helperText="Can't be empty" />

				<RadioGroup
					aria-label="gender"
					name="gender1"
					value={radioValue}
					onChange={(event) => setRadioValue(event.target.value)}>
					<FormControlLabel value="Video" control={<Radio />} label="Video" />
					<FormControlLabel value="Playlist" control={<Radio />} label="Playlist" />
				</RadioGroup>

				<Button
					color="primary"
					variant="outlined">Submit
				</Button>
			</FormControl>

		</div>
	);
}

export default EnterLink;
